import React from 'react';
import Button from "react-bootstrap/Button";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavbarBrand from "react-bootstrap/NavbarBrand";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSignOutAlt } from '@fortawesome/free-solid-svg-icons'
import { faBoxOpen } from '@fortawesome/free-solid-svg-icons'
import { faCoins } from '@fortawesome/free-solid-svg-icons'

export default class NavbarComponent extends React.Component{
    render() {
        return (
            <Navbar style={{backgroundColor: "#0D0D0D"}}>
                <Nav className="mr-auto">
                    <NavbarBrand style={{color: "#ff0000"}}>Pokemon Thing</NavbarBrand>
                </Nav>
                <Nav>
                    <Nav.Link href="#"><FontAwesomeIcon icon={faBoxOpen}/> Open Packs</Nav.Link>
                    <Nav.Link href="#"><FontAwesomeIcon icon={faCoins}/> Shop</Nav.Link>
                    <Nav.Link href="#"><FontAwesomeIcon icon={faSignOutAlt}/> Sign Out</Nav.Link>
                </Nav>
            </Navbar>
            
        );
    }
}
